import React, { Component } from 'react';
import Main from './components/main/Main'
// import Turbulance from './components/Turbulance'
import './App.css';

class App extends Component {
  state = {
    session: false
  }
  handleSession = session => {
    this.setState(state => ({
      session: !state.session
    }));
  }
  render() {
    return (
      <div className="App">
        <div>
          <Main onLogIn={this.handleSession} />
        </div>
        {/* <Turbulance /> */}
        <div>
        </div>
      </div>
    );
  }
}

export default App;
